The Librarian: The Curse of the Judas Chalice (2008)

Ergens in Amerika worden de grootste schatten ter wereld verborgen gehouden, zoals het zwaard Excalibur, de Ark van het Verbond en de doos van Pandora. Flynn Carsen, een dertigjarige studiebol, is de beheerder van deze geheime verzameling. Op een dag stelen leden van de Serpent Brotherhood, een gevaarlijke sekte, een stuk van de eeuwenoude Spear of Destiny, een speer die in zijn geheel het lot van de wereld kan bepalen. Aan Flynn de taak om de overige delen van het relikwie op te sporen. Samen met Nicole Noone, een specialiste in vechtsport, start Flynn aan de gevaarlijke tocht die hen tot in de verste uithoeken van de wereld doet belanden. Op de hielen gezeten door de Serpent Brotherhood beginnen Flynn en Nicole aan een grandioos avontuur vol spanning en spektakel.

